    "2015-09-26T23:16:35.170815",nt"name": "tao-triton-rama-and-pirata-buoys-daily-dynamic-height",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset has daily Dynamic Height data
    (a measure of the elevation of the sea level, calculated by integrating the specific
    volume anomaly of the sea water between the sea surface and 500 m depth) from the
    nTAO/TRITON (Pacific Ocean, http://www.pmel.noaa.gov/tao/),nRAMA (Indian Ocean,
    http://www.pmel.noaa.gov/tao/rama/), andnPIRATA (Atlantic Ocean, http://www.pmel.noaa.gov/pirata/)narrays
    of moored buoys which transmit oceanographic and meteorological data to shore in
    real-time via the Argos satellite system.  These buoys are major components of the
    CLIVAR climate analysis project and the GOOS, GCOS, and GEOSS observing systems.
     Daily averages are computed starting at 00:00Z and are assigned an observation
    'time' of 12:00Z.  For more information, seenhttp://www.pmel.noaa.gov/tao/proj_over/proj_over.html
